import React, { Component } from 'react'
import {  Icon, Header,Image } from 'semantic-ui-react'

export default class Description extends Component {
  render() {
    return (
      <div>
        <Header inverted as='h2' icon textAlign='center'>
      <Image fluid src='http://localhost:5000/images/progress.png' size='huge'  floated='left'  circular />
      <Header.Content>Friends</Header.Content>
    </Header>
    <Image centered size='large' src='https://react.semantic-ui.com/images/wireframe/centered-paragraph.png' />
      </div>
    )
  }
}
